    false,nt"url": null,nt"notes": "The data was created by reviewing the information
    contained in the Site Summaries. If the Site Summary contained a latitude/longitude
    of the location, the ArcView Geotools extension was used to create the point shp
    file. If the coordinate was not know, the tool was used to identify the coordinate
    by selecting the location from a georeferenced USGS quad map. The extents were identified
    from the Site Summary and each extents was copied from the 24K Coast shp file or
    from the Delta Shp file. The Xtools extension was used to cut and copy each segment
